import { useNavigate } from "react-router-dom";

const Contentt = () => {
    const navigate =  useNavigate();
    return(
        <div>
            <h3>Contentt</h3>
            <button onClick={()=> navigate('/')}>Cover</button>
        </div>
    )
};

export default Contentt;
